import React from 'react'
import { Link } from "react-router-dom";

export const Register = () => {


    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
  return (
    <div>
         return (
        <div className='d-flex vh-100 justify-content-center align-items-center bg-primary'>
            <form>
                <div className='mb-3'>
                    <label htmlFor="inputFName" className="form-label mt-4" style={{ color: 'white' }}>First Name</label>
                    <label htmlFor="inputLName" className="form-label mt-4" style={{ color: 'white' }}>Last Name</label>

                    {/* When input changes, setEmail retrieves value and update email variable */}
                    <input type="email" className="form-control" id="inputEmail" aria-describedby="emailHelp" placeholder="Enter email" 
                    onChange={(e) => setEmail(e.target.value)}
                    />
                </div>
                <div className='mb-3'>
                    <label htmlFor="inputPassword" className="form-label mt-4" style={{ color: 'white' }}>Password</label>
                    {/* When input changes, setPassword retrieves value and update password variable */}

                    <input type="password" className="form-control" id="inputPassword" placeholder="Password" autocomplete="off" 
                    onChange={(e) => setPassword(e.target.value)} />
                    <input type="password" className="form-control" id="inputConfirmPassword" placeholder="Confirm" autocomplete="off" />

                </div>
                <button type="submit" className="btn btn-secondary">Create Account</button>
                <p to = '/Login' >Already an account? <Link to='/Login'>Login</Link></p>


            </form>
        </div>
    </div>
  )
}
